import React from "react"
import DisplayPic from "./displayPic"
import cplus from "../pictures/c++_logo.jpg"
import csharp from "../pictures/c#-logo.jpeg"
import css from "../pictures/css-logo.png"
import es6 from "../pictures/es6-logo.png"
import git from "../pictures/git_logo.png"
import html from "../pictures/html5_logo.png"
import node from "../pictures/nodejs.png"
import postgres from "../pictures/postgres_logo.jpg"
import react from "../pictures/react_logo.png"
import redux from "../pictures/redux_logo.png"
import unity from "../pictures/unity_logo.jpg"
const height = "300px"
const width = "300px"


const Skills = () =>{
    return(
        <div>
            <DisplayPic
            source = {cplus}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {csharp}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {css}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {es6}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {git}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {html}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {node}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {postgres}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {react}
            width = {width}
            height = {height}
            />
            <DisplayPic 
            source = {csharp}
            width = {width}
            height = {height}
            />
        </div>
    )
}

export default Skills
